import React, { useRef, useEffect, useState} from "react";
import actionTree from "../../data/actionTree.json";

const ActionLog = (props) => {

	return (
		<div className="actionLogContainer">
      <p className="title">Query Log</p>
      {
        actionTree.map((action) => (
          <div className="actionLogWrapper">
            <div className="timeStampWrapper">
              <p>{action.attributes.timestamp_start}</p>
              <p>{action.attributes.timestamp_end}</p>
            </div>
            <p>{action.attributes.query}</p>
          </div>
        ))
      }
    </div>
	);
};

export default ActionLog;
